webpackJsonp([0x66ce82f45f02],{6506:function(e,t){e.exports={data:{post:{html:'<p>In defence of the <a href="http://www.papascott.de/2003/11/13/2701.php">Roadster</a> incident, MamaMaus offers this picture (taken for insurance purposes) of the gas pump in question, which at the bottom carries a V-Power sticker on the <em>diesel</em> side of the pump. Therefore, at first glance, it is not totally stupid to believe that V-Power is some sort of souped-up diesel.</p>\n<p><img alt="vpowerpump.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2003/11/vpowerpump.jpg" width="244" height="325" border="0" /></p>\n<p>It will be interesting to see who ends paying for the damage. Unless, of course, it comes out of our pocket, in which case it would be not interesting, but tragic.</p>',fields:{title:"Roadster Update",date:"16 Nov 2003",url:"https://papascott.de/2003-11-16-roadster-update/"}}},pathContext:{slug:"/2003-11-16-roadster-update/",prev:{fields:{title:"Aldi USA in Minnesota",date:"16 Nov 2003",slug:"/2003-11-16-aldi-usa-in-minnesota/"}},next:{fields:{title:"Fear of Cows",date:"17 Nov 2003",slug:"/2003-11-17-fear-of-cows/"}}}}}});
